import React from "react";
import {Link  } from "react-router-dom";
export default function Turler() {
  return (
    <div style={{
        width:"1000px",
        height:"500px",
        display: "inline-block",
    }}>
        <Link to={`/cavalier-king-charles-spaniel`}>
            <b>cavalier-king-charles-spaniel</b>
          </Link>
          <Link to={`/tur/golden-retriever`}>
            <b>/tur/golden-retriever</b>
          </Link>
          <Link to={`/tur/chihuahua`}>
            <b>/tur/chihuahua</b>
          </Link>
          <Link to={`/tur/shepherd`}>
            <b>/tur/chihuahua</b>
          </Link>
        
    </div>
  );
}
